  [],\n\t\"num_tags\": 0,\n\t\"name\": \"digital-data-sets-that-describe-aquifer-characteristics-of-the-enid-isolated-terrace-aquifer-in00895\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of digitized aquifer
  boundaries for the Enid isolated terrace aquifer in northwestern Oklahoma. The Enid
  isolated terrace aquifer covers approximately 82 square miles and supplies water
  for irrigation, domestic, municipal, and industrial use for the City of Enid and
  western Garfield County. The Quaternary-age Enid isolated terrace aquifer is composed
  of terrace deposits that consist of discontinuous layers of clay, sandy clay, sand,
  and gravel. The aquifer is unconfined and is bounded by the underlying Permian-age
  Hennessey Group on the east and the Cedar Hills Sandstone Formation of the Permian-age
  El Reno Group on the west. The Cedar Hills Sandstone Formation fills a channel beneath
  the thickest section of the Enid isolated terrace aquifer in the midwestern part
  of the aquifer. The aquifer boundaries were digitized and created from information
  and maps in a ground-water modeling thesis and report of the Enid isolated terrace
  aquifer. The map digitized was published at a scale of 1:62,500.\",\n\t\"owner_org\":
